SET NOCOUNT ON;
DECLARE @inserted0 TABLE ([Id] uniqueidentifier, [_Position] [int]);
MERGE [Audit] USING (
VALUES (@p0, @p1, @p2, @p3, @p4, @p5, @p6, @p7, 0),
(@p8, @p9, @p10, @p11, @p12, @p13, @p14, @p15, 1),
(@p16, @p17, @p18, @p19, @p20, @p21, @p22, @p23, 2),
(@p24, @p25, @p26, @p27, @p28, @p29, @p30, @p31, 3),
(@p32, @p33, @p34, @p35, @p36, @p37, @p38, @p39, 4),
(@p40, @p41, @p42, @p43, @p44, @p45, @p46, @p47, 5)) AS i ([AffectedColumns], [DateTime], [NewValues], [OldValues], [PrimaryKey], [TableName], [Type], [UserId], _Position) ON 1=0
WHEN NOT MATCHED THEN
INSERT ([AffectedColumns], [DateTime], [NewValues], [OldValues], [PrimaryKey], [TableName], [Type], [UserId])
VALUES (i.[AffectedColumns], i.[DateTime], i.[NewValues], i.[OldValues], i.[PrimaryKey], i.[TableName], i.[Type], i.[UserId])
OUTPUT INSERTED.[Id], i._Position
INTO @inserted0;

SELECT [t].[Id] FROM [Audit] t
INNER JOIN @inserted0 i ON ([t].[Id] = [i].[Id])
ORDER BY [i].[_Position];

INSERT INTO [Motor] ([Id], [AddedBy], [BodyTypeId], [ChassisNumber], [ClaimFreeGroup], [Colour], [DateAdded], [DateModified], [DaysOutOfCountry], [DriverTypeId], [EngineCapacity], [EngineNumber], [FinancialInterest], [IsAlarm], [IsGearLock], [IsImmobiliser], [IsImmobiliserFactoryFitted], [IsImport], [IsSecurityFitting], [IsTrackingDevice], [ModifiedBy], [MotorModelId], [MotorUseId], [OdometerReading], [RegNumber], [RegYear])
VALUES (@p48, @p49, @p50, @p51, @p52, @p53, @p54, @p55, @p56, @p57, @p58, @p59, @p60, @p61, @p62, @p63, @p64, @p65, @p66, @p67, @p68, @p69, @p70, @p71, @p72, @p73);
INSERT INTO [Quote] ([Id], [AddedBy], [ClientInfo], [DateAdded], [DateModified], [InsurerBranchId], [InternalInfo], [IsFulfilled], [IsPaid], [IsPolicySet], [ModifiedBy], [PortfolioClientId], [QuoteDate], [QuoteNumber], [QuoteStatusId], [RunDay])
VALUES (@p74, @p75, @p76, @p77, @p78, @p79, @p80, @p81, @p82, @p83, @p84, @p85, @p86, @p87, @p88, @p89);
INSERT INTO [QuoteItem] ([Id], [AddedBy], [ClientRiskId], [CoverTypeId], [DateAdded], [DateModified], [Description], [Excess], [ModifiedBy], [Premium], [QuoteId], [SumInsured], [TaxAmount], [TaxRate])
VALUES (@p90, @p91, @p92, @p93, @p94, @p95, @p96, @p97, @p98, @p99, @p100, @p101, @p102, @p103);

